import React from "react";

function Footer() {
  return (
    <footer id="contact">
      <p>Contact us: <a href="tel:7683061117">7683061117</a></p>
      <p>
        &copy; {new Date().getFullYear()} <a href="/">officebanao.in</a>. All Rights Reserved.
      </p>
    </footer>
  );
}

export default Footer;
